    <style>
        html, body {
            height: 100%;
        }
        .black-border {
            background-color: black;
            min-height: 100%;
            height: 100%;
            width: 30%;
            transform: skew(-23.1deg);
            position: absolute;
            top: 0;
            left: 0;
            transform-origin: left top;
        }
        .bodymovin {
            width: 300px;
            max-width: 100%;
            left: 50px;
            top: 50px;
            position: absolute;
        }
        .navbar {
            width: 100%;
            background-color: black;
            height: 80px;
        }
        nav {
            height: 80px;
            width: 100%;
        }
        nav a, nav a:hover {
            color: white;
            padding: 15px;
            font-size: 20px;
        }
        nav ul {
            display: flex;
            list-style-type: none;
            padding: 24px;
        }
        .contact {
            margin: 0 0 50px 0;
        }
        .contact a {
            color: #212529;
        }
        #teaminova {
            width: 70%;
            position: absolute;
            top: 0;
            right: 0;
            overflow: hidden;
        }
        .heading {
            margin: 50px 0;
        }
        .icons a:hover {
            text-decoration: none;
        }
        .fab {
            color: #3c3c3c;
            font-size: 40px;
            padding: 15px;

        }
        .fab:hover {
            color: black;
        }
        @media (max-width: 1400px) {
            .black-border {
                display: none;
            }
            .bodymovin {
                top: 0;
                left: 20px;
                width: 180px;
                z-index: 10;
            }
            #teaminova {
                width: 100%;
            }
            nav {
                margin-left: 180px;
            }
        }
        @media (max-width: 860px) {
            nav ul li {
                display: none;
            }
        }
    </style>
</head>
